Example code updated in light.js

```
  function setup(){
  createCanvas(100,100,WEBGL);
  camera(0,-100,300);
}
  function draw(){
  background(230);
  ambientMaterial(237,34,93); //Pink Material
  ambientLight(mouseY); 
  //As you move the mouse up to down it changes from no ambient light to full ambient light.
  rotateY(millis()/2000);
  box(100);
}
```

