Merge pull request #2620 from Spongman/move-edgesToVertices

move _edgedToVertices

this just moves _edgedToVertices from p5.Renderer (which it doesn't use at all) to p5.Geometry so it can be used as a fluent method like the other geometry methods.

geometry initialization which previously looked like:

boxGeom._makeTriangleEdges();
this._renderer._edgesToVertices(boxGeom);
now becomes

boxGeom._makeTriangleEdges()._edgesToVertices();

Fixes an issue where get() return single pixel when caller asks for image

If you ask for a section of the image like in the following code, when the video is not ready, `get()` now returns a single pixel which breaks a call to `image()`.  This could be solved with error handling in the end-user's code, but I'm adding something where `get()` returns a blank image until it's ready.  

```javascript
  var img = video.get(200,200,50,50);
  image(img, 0, 0);
```
